import Header from './Frontpage/Header';
import DesignsLayover from './Frontpage/DesignsLayover';
import Content3 from './Frontpage/Content3';
import Footer from './Frontpage/Footer';
import { Router, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
    <div>
      <Header/>
      <Route path='\'></Route>
      <DesignsLayover/>
      {/* <h2>Hello world</h2> */}
      <Content3/>
      <Footer/>
    </div>
    </Router>
  );
}

export default App;
